package myproject;

public class LogicalOperator {

    public static void main(String[] args) {
        // TODO Auto-generated method stub
        int x=6;
        //logical AND
        System.out.println(x>10 && x<5);
        //logical OR
        System.out.println(x<10 || x>20);
        //Logical NOT
        System.out.println(!(x<10 && x>5));
    }

}
